import _ from 'lodash'
import { FETCH_POSTS } from '../actions/notes'

export default function (state = {}, action) {
  switch (action.type) {
    case FETCH_POSTS:
      return _.mapKeys(action.payload.data.results, 'id')
    default:
      return state
  }
}
